import React,  { createContext, useState } from 'react';

export const AuthContext = createContext({});

export const AuthProvider = (props) => {
    const [session, setSession] = useState()
    return (
        <AuthContext.Provider value={{
            session, setSession
        }}>
            {props.children}
        </AuthContext.Provider>
    )
}
